package org.jeecg.modules.ftp.until;

import sun.misc.BASE64Decoder;

import java.io.*;
import java.text.SimpleDateFormat;
import java.util.Date;

/*
 * 解析北大医信回传的odt文件base64流
 */
public class Base64ToODT {
	public static void main(String[] args) {
		BASE64Decoder decoder = new BASE64Decoder();
		byte[] bytes =null;
		String base64 = "";
		try {
			 bytes = decoder.decodeBuffer(base64);// base64编码内容转换为字节数组
		}catch (Exception e){
		}
		Base64ToODT.base64StringToPdf(bytes, "D:\\1234.odt");
		
	}
	public static String base64StringToPdf(byte[] bytes , String fileName) {
		BASE64Decoder decoder = new BASE64Decoder();
		BufferedInputStream bis = null;
		FileOutputStream fos = null;
		BufferedOutputStream bos = null;
		String filePath="上传失败";
		try {
			ByteArrayInputStream byteInputStream = new ByteArrayInputStream(
					bytes);
			bis = new BufferedInputStream(byteInputStream);
			Base64ToODT base64ToODT=new Base64ToODT();
			String url=base64ToODT.fileUrl();
			filePath=url+"/"+fileName;//按照规则生成路径
			File file = new File(filePath);
			File path = file.getParentFile();
			if (!path.exists()) {
				path.mkdirs();
			}
			fos = new FileOutputStream(file);
			bos = new BufferedOutputStream(fos);
			byte[] buffer = new byte[1024];
			int length = bis.read(buffer);
			while (length != -1) {
				bos.write(buffer, 0, length);
				length = bis.read(buffer);
			}
			bos.flush();
		} catch (Exception e) {
			e.printStackTrace();
		} finally {
			if(bos!=null){
				try {
					bos.close();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
			if(fos !=null){
				try {
					fos.close();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
			if(bis!=null){
				try {
					bis.close();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		}
		return filePath;
	}
	public static String fileUrl(){
		Date date=new Date();
		SimpleDateFormat sdf=new SimpleDateFormat("yyyy");
		SimpleDateFormat sdf1=new SimpleDateFormat("MM");
		SimpleDateFormat sdf2=new SimpleDateFormat("dd");
		String year=sdf.format(date);
		String yue=sdf1.format(date);
		String day=sdf2.format(date);
		String url="E:/镇雄/"+year+yue+"/"+day;
		return url;
	}
}
